export default function commerceReducer(state = initialState, action: IAction) {
  switch (action.type) {
    case commerceActions.ADD_ITEM:
      return [...state, {...action.payload, id: Date.now()}];

    case commerceActions.DELETE_ITEM:
      return state.filter((product) => product.id !== action.payload);

    default:
      return state;
  }
}
